import React from 'react';
import ReactDOM from 'react-dom';
import Card from './List';
import Para from './Para';



ReactDOM.render(  <>
{
    Para.map( function (val){
      return
      <Card 
  imgsrc={Para[0].imgsrc}
  title = {Para[0].title}
  sname={Para[0].imgsrc.sname}
  link={Para[0].imgsrc.link}
  />;
    })             


}
  </>
  , document.getElementById('root')
);
